import React from "react";
import '../style.css';

const intialState = {
    project: [
        {name: "Name", description: "Description"}
    ],
    addProject: []
}

export const mainFunction = (state = intialState, action) => {
    switch (action.type) {
        case "ADD_PROJECT":
            return {
                ...state,
                addProject: [...state.cart, action.data]
            }
            default: return state;
    }
}


const Projects = () => {
    return (
        <div>
            <div>Projects</div>
        </div>
    )
}

export default Projects;
